import React, { useState, useRef } from "react";
import { View, Button, StyleSheet, Alert, ActivityIndicator, Text } from "react-native";
import { WebView } from "react-native-webview";
import * as Sharing from "expo-sharing";
import * as FileSystem from "expo-file-system";
// import jsPDF from "jspdf";

export default function PropostaPdfScreen() {
  const webViewRef = useRef<WebView>(null);
  const [pdfUri, setPdfUri] = useState<string | null>(null);
  const [loading, setLoading] = useState(false);
  
  const dataFormatada = new Intl.DateTimeFormat('pt-BR', {
    weekday: 'long',
    day: 'numeric',
    month: 'long',
    year: 'numeric',
  }).format(new Date());

  const htmlContent = `
    <!DOCTYPE html>
    <html lang="pt-BR">
    <head>
      <meta charset="UTF-8">
      <meta name="viewport" content="width=794, user-scalable=yes">
      <title>Proposta Comercial</title>
      <style>
        @font-face {
          font-family: 'Kollektif';
          src: url('data:font/ttf;charset=utf-8;base64,') format('truetype');
        }
          @font-face {
          font-family: 'Lato';
          src: url('file:@/src/styles/fonts/Lato-Regular.ttf');
        }

        * {
          margin: 0;
          padding: 0;
          box-sizing: border-box;
        }

        .page {
          background: white;
          border-bottom: 16px solid #ccc ;
        }

        .content {
          margin: 20mm;
          width: 170mm;
          height: 257mm;
          border: 12px solid black;
          position: relative;
        }

        .triangle {
          width: 0px;
          height: 0px;
          border-style: solid;
          border-width: 700px 620px 0 0;
          border-color: #000000 transparent transparent transparent;
          transform: rotate(0deg);
          z-index: 99;
        }

        #moldura {
          width: 600px;
          height: 680px;
          position: absolute;
          top: 0;
          left: 0;
          z-index: 100;
        }

        .triangle2 {
          width: 0px;
          height: 0px;
          border-style: solid;
          border-width: 320px 320px 0 0;
          border-color: #000000 transparent transparent transparent;
          transform: rotate(0deg);
          z-index: 101;
          position: absolute;
          top: 0;
          left: 0;
        }

        .overlay {
          width: 0px;
          height: 0px;
          border-style: solid;
          border-width: 700px 620px 0 0;
          border-color: #000000c0 transparent transparent transparent;
          transform: rotate(0deg);
          position: absolute;
          top: 0;
          left: 0;
          z-index: 102;
        }
          
        h1 {
          position: absolute;
          font-size: 36px;
          text-align: right;
          top: 90mm;
          right: 8mm;
          font-family: 'Kollektif';
          font-weight: normal;
        }

        h2 {
          top: 128mm;
          right: 8mm;
          font-weight: normal;
        }

        h3 {
          top: 136mm;
          right: 8mm;
        }

        h4 {
          top: 160mm;
          right: 8mm;
        }

        .titulo {
          position: absolute;
          text-align: right;
          font-family: 'Lato';
          font-size: 16px;
          font-weight: 600;
        }

        .rect {
          width: 30px;
          height: 10px;
          position: absolute;
          background-color: #00949A;
        }

        #rect1 {
          right: 8mm;
          top: 142mm;
        }

        #rect2 {
          right: 8mm;
          top: 188mm;
        }
        
        .texto {
          position: absolute;
          text-align: right;
          font-family: 'Lato';
          font-size: 16px;
          font-weight: 300;
        }

        #nome {
          right: 8mm;
          top: 146mm;
        }

        h6 {
          right: 8mm;
          top: 182mm;
        }
        
        #endereco {
          right: 8mm;
          top: 192mm;
        }

        #kwp {
          right: 8mm;
          top: 170mm;
          font-size: 28px;
        }

        #cidade {
          right: 8mm;
          top: 210mm;
        }

        #logo {
          max-width: 100%;
          height: auto;
          margin-top: 8px;
          z-index: 103;
          position: absolute;
          top: 14px;
          left: 14px;
          width: 150px;
        }

        .secao {
          position: absolute;
          font-family: 'Kollektif';
          font-size: 26px;
          font-weight: 600;
          color: #00949A;
        }

        #funcionamento {
          top: 10mm;
          left:15mm;
        }

        #info {
        position:absolute;
        right: 8mm;
        top:22mm;
        width:380px;
        }

        #monitoramento {
          top: 100mm;
          left:15mm;  
        }
      </style>
    </head>
    <body>

      <!-- Pgina 1 -->
      <div class="page">
        <div class="content">
          <div class="triangle"></div>        
          <div id="moldura">
            <svg 
              width="600" 
              height="680" 
              viewBox="0 0 600 680"
            >
              <defs>
                <clipPath id="clip-triangle">
                  <polygon points="0,0 600,0 0,680" />
                </clipPath>
              </defs>
              <image 
                href="data:image/png;base64," 
                width="600" 
                height="680"
                clip-path="url(#clip-triangle)"
                preserveAspectRatio="xMidYMid slice"
              />
            </svg>
          </div>
          <div class="triangle2"></div>
          <img id="logo" src="data:image/png;base64," /img>
          <div class="overlay"></div>
          <h1>PROPOSTA</br>COMERCIAL</h1>
          <h2 class="texto">${dataFormatada}</h2>
          <h3 class="titulo">Cliente</h3>
          <div id="rect1" class="rect"></div>
          <p id="nome" class="texto">Joo da Silva</p>
          <h4 class="titulo">UC</h4>
          <h5 id="kwp" class="titulo">2,44 kWp</h5>
          <h6 class="titulo">Endereo</h3>
          <div id="rect2" class="rect"></div>
          <p id="endereco" class="texto">Rua das Flores, 123 - Bairro Centro</p>
          <p id="cidade" class="texto">Maring - PR</p>
        </div>
      </div>

      <!-- Pgina 2 -->
      <div class="page">
        <div class="content">
          <h7 id="funcionamento" class="secao">FUNCIONAMENTO</h7>
          <img id="info" src="data:image/jpeg;base64," />

          <h8 id="monitoramento" class="secao">MONITORAMENTO</h5>

        </div>
      </div>

    </body>
    </html>
  `;

  const generatePdf = async () => {
    setLoading(true);
    try {
      const jsCode = `
        (function() {
          const content = document.body;
          html2canvas(content, {scale: 2}).then(canvas => {
            const imgData = canvas.toDataURL('image/png');
            window.ReactNativeWebView.postMessage(imgData);
          });
        })();
        true;
      `;
      webViewRef.current?.injectJavaScript(jsCode);
    } catch (error) {
      setLoading(false);
    }
  };

  const onMessage = async (event: any) => {
    try {
      const imgBase64 = event.nativeEvent.data;
      if (!imgBase64.startsWith("data:image/png")) {
        setLoading(false);
        return;
      }

      const pdf = new jsPDF({
        unit: "pt",
        format: "a4",
      });

      const imgProps = pdf.getImageProperties(imgBase64);
      const pdfWidth = pdf.internal.pageSize.getWidth();
      const pdfHeight = (imgProps.height * pdfWidth) / imgProps.width;

      pdf.addImage(imgBase64, "PNG", 0, 0, pdfWidth, pdfHeight);

      const pdfBase64 = pdf.output("datauristring").split(",")[1];
      const fileUri = FileSystem.documentDirectory + "proposta.pdf";

      await FileSystem.writeAsStringAsync(fileUri, pdfBase64, {
        encoding: FileSystem.EncodingType.Base64,
      });

      setPdfUri(fileUri);
      setLoading(false);
    } catch (err) {
      setLoading(false);
    }
  };

  const sharePdf = async () => {
    if (!pdfUri) {
      Alert.alert("PDF no gerado", "Por favor, gere o PDF primeiro.");
      return;
    }
    await Sharing.shareAsync(pdfUri, {
      mimeType: "application/pdf",
      dialogTitle: "Compartilhar Proposta Comercial",
    });
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Pr-visualizao da Proposta</Text>

      <View style={styles.webviewContainer}>
        <WebView
          ref={webViewRef}
          originWhitelist={["*"]}
          source={{ html: htmlContent }}
          onMessage={onMessage}
          injectedJavaScriptBeforeContentLoaded={`window.html2canvas = null;`}
          javaScriptEnabled={true}
          domStorageEnabled={true}
          style={styles.webview}
          injectedJavaScript={`
            (function() {
              if (!window.html2canvas) {
                var script = document.createElement('script');
                script.src = 'https://cdn.jsdelivr.net/npm/html2canvas@1.4.1/dist/html2canvas.min.js';
                script.onload = () => { window.ReactNativeWebView.postMessage('html2canvas loaded'); };
                document.head.appendChild(script);
              }
            })();
            true;
          `}
        />
      </View>

      {loading && <ActivityIndicator size="large" color="blue" style={{ marginVertical: 10 }} />}

      <View style={styles.buttonsContainer}>
        <Button title="Gerar PDF" onPress={generatePdf} disabled={loading} />
        <Button title="Compartilhar PDF" onPress={sharePdf} disabled={!pdfUri || loading} />
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingHorizontal: 20,
    paddingTop: 50,
  },
  title: {
    fontSize: 22,
    fontFamily: "Inter-Bold",
    marginBottom: 20,
    marginTop: 50,
    textAlign: "center",
  },
  webviewContainer: {
    flex: 1,
    backgroundColor: "#ccc",
    borderRadius: 12,
    overflow: "hidden",
    elevation: 3,
    shadowColor: "#000",
    shadowOpacity: 0.1,
    shadowOffset: { width: 0, height: 2 },
    shadowRadius: 4,
    padding: 8,
  },
  webview: {
    flex: 1,
  },
  buttonsContainer: {
    flexDirection: "row",
    justifyContent: "space-around",
    paddingVertical: 10,
    backgroundColor: "#eee",
    borderRadius: 8,
  },
});
